import React, { Component } from "react";
import {Link} from 'react-router-dom'
import logo from '../image/logodate.png'

export default class Signup extends Component {
    state = {
        LoginUsername: '',
        LoginPassword: '',
        NewUsername: '',
        NewPassword: '',
        email: '',
        lastname:'',
        firstname:''
    }        

    handleChange = (event) => {
        this.setState({
            [event.target.id]: event.target.value,
        });
    }

    render() {
        return (
            <div>
                <form onSubmit={ (evt) => this.props.handleSignUp(evt) }>
                <h3><img src={logo}/></h3>
                <h3>Sign Up</h3>

                <div className="form-group">
                    <label>First name</label>
                    <input value={this.props.FirstName} onChange={this.props.handleChange} type="text" className="form-control" placeholder="First name"  />
                </div>

                <div className="form-group">
                    <label>Last name</label>
                    <input onChange={this.props.handleChange} value={this.props.LastName} type="text" className="form-control" placeholder="Last name" />
                </div>

                <div className="form-group">
                    <label>Username</label>
                    <input onChange={this.props.handleChange} value={this.props.NewUsername} type="text" className="form-control" placeholder="Enter Username" />
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input onChange={this.props.handleChange} value={this.props.NewPassword} type="password" className="form-control" placeholder="Enter password" />
                </div>

                <button type="submit" className="btn btn-primary btn-block">Sign Up</button>
                <p>
                      <Link className="forgot-password text-right" to={"/"}>Already Signed Up sign in?</Link>
                </p>
            </form>
            </div>
        );
    }

}
